import logo from "./logo.svg";
import "./App.css";
import { Button } from "@material-ui/core";
import Header from "./Header";
import { createMuiTheme } from "@material-ui/core/styles";

const styles = {
  button: {},
};

const theme = createMuiTheme({
  palette: {
    primary: {
      light: "#757ce8",
      main: "#3f50b5",
      dark: "#002884",
      contrastText: "#fff",
    },
    secondary: {
      light: "#ff7961",
      main: "#f44336",
      dark: "#ba000d",
      contrastText: "#000",
    },
  },
});

function App() {
  return (
    <div className="App">
      <header className="App-header"></header>
      <Header />
      <p>sdsf</p>
    </div>
  );
}

export default App;
